(58749, 'koKR', '빌시크의 비행', '애완동물 대전에서 그릭시스 타이니팝을 꺾어야 합니다.', '', '', '', '', '', '', '', 35435),
(58742, 'koKR', '구도자 레티누스', '애완동물 대전에서 그릭시스 타이니팝을 꺾어야 합니다.', '', '', '', '', '', '', '', 35435),
(58741, 'koKR', '석재 가공', '영원꽃 골짜기에 있는 모구 병기 $1oa개를 수집해야 합니다.', '다른 모구와 전쟁을 치를 때면 발생하는 고질적인 문제가 있다. 바로 돌과 금속으로 이루어진 적수에게 무기를 휘두르다 보면 삽시간에 무뎌지고 부러진다는 것이지. \n\n라자니에서 대장장이는 나 하나뿐인지라 간혹 전사들의 수요를 따라가기 벅찬 상황이 벌어지기도 한다.\n\n모구와 싸우면서 무기를 입수하거든 가져와라. 뜻깊은 일에 사용하마.', '', '', '', '', '', '', 35435),
