(57721, 'koKR', '전쟁 전리품', '영원꽃 골짜기에 있는 모구에게서 회수한 모구 방어구 $1oa개를 입수해야 합니다.', '전쟁에 여념 없는 부족들은 지칠 줄 모르는데, 우리 전사들의 방어구 소모 속도는 내가 유지 보수할 수 있는 정도를 넘어서고 있다.\n\n혹 다른 부족의 병사들과 충돌하거든 온전한 방어구를 수거해다오. 요긴한 자원을 아깝게 낭비할 순 없지.', '', '', '', '', '', '', 35435),
(57591, 'koKR', '정신 흡수자', '', '', '', '', '', '', '', '', 35435),
