(57586, 'koKR', '정신 흡수자', '', '', '', '', '', '', '', '', 35435),
(57401, 'koKR', '\"마지막 진실\" 복원 작업', '공포의 환영의 상실 지역에서 \"마지막 진실\"의 찢어진 책장을 입수하여 심장의 방에 있는 래시온에게 전달해야 합니다.', '고대 신의 비밀을 연구한 지 오랜 시간이 지났구나. 다가올 공포에 대비하기 위해 아제로스 전역을 누비며 난해한 문헌을 찾고, 잊힌 기록과 금지된 지식까지 찾았지.\n\n아무리 많이 연구해도 이 책에 적힌 깊은 광기에 대비하기에는 부족했을 것이다. 이 광기는 너무나도 절대적인 나머지 샤트아르어만 이를 전달할 수 있었으니.\n\n이 저주받을 고서의 마지막 책장을 찾아와라, $n. 배워야 할 것을 다 배우고 나면 이 고서를 두 번 다시 보고 싶지 않구나.', '', '', '', '', '', '', 35435),
(57323, 'koKR', '용 결속', '', '', '', '', '', '', '', '', 35435),
