(56889, 'koKR', '사막유랑단 부상자', '사막유랑단 일꾼 $1oa명을 치료해야 합니다.', '아, 친구여. 일손을 거들러 오셨습니까?\n\n보시다시피 괴물들과의 전투는 여전히 현재 진행형입니다. 말 그대로 끝없이 몰려옵니다.\n\n명백한 소모전이죠. 문제는 우리 측 부상자들이 폭증하고 있어서 두말할 것도 없이 불리한 상황이란 겁니다.\n\n간곡히 부탁드립니다. 폐허에서 부상자를 찾으면 도와주십시오.', '', '', '', '', '', '', 35435),
(56402, 'koKR', '사막유랑단 동전', '사막유랑단 동전 $1oa개를 수집해야 합니다.', '쓰러진 형제자매들을 구하기엔 너무 늦었을지 몰라도, 유가족에게 한 줌의 위안을 전하기엔 아직 늦지 않았소.\n\n사막유랑단이라면 누구나 우리 집단 내에서의 신분을 나타내는 고유한 동전을 소지한다오.\n\n설혹 그런 동전을 찾거든 가져오시오. 내 책임지고 친족에게 전달할 터이니.', '', '', '', '', '', '', 35435),
