(54619, 'koKR', '마른나무껍질 퇴치', '아라시 고원에 있는 마른나무껍질 부족 트롤 $1oa마리를 처치해야 합니다.', '피에 굶주린 마른나무껍질 부족은 늘 호드 편에 서는 걸 거절했다네... 이제 호드가 아라시를 점령했으니 얼라이언스가 하지 못한 일을 하세나.\n\n고원에서 저 숲트롤들을 몰아내게.', '', '', '', '', '', '', 35435),
(54617, 'koKR', '비밀결사대의 죄', '고셰크 농장에서 비밀결사대 $1oa명을 처치해야 합니다.', '아라소르 연맹으로도 모자라서 비밀결사대 요원들이 알터랙 산맥에서 기어 나와 선량한 호드 일꾼들을 몰아냈다네.\n\n놈들을 응징하게.', '', '', '', '', '', '', 35435),
