(54497, 'koKR', '위험한 조합', '', '', '', '', '', '', '', '', 35435),
(54436, 'koKR', '위습과 함께 사라지다', '잿불내림 숲을 점령하고 위습을 격려하여 도움을 받아야 합니다.', '시작이 좋군요. 그래도 이 전투를 승리로 이끌어가려면 목재 수급이 더 필요해요!\n\n호드가 바샬아란 북쪽의 스산한 십자로 너머에 제재소를 만들어뒀습니다. 우리가 그 제재소를 점령하면 호드의 숲 파괴를 막으면서 동시에 위습을 시켜 더 많은 목재를 모을 수 있을 거예요.\n\n이런 게 일석이조라는 거죠!', '', '', '', '', '', '', 35435),
(54434, 'koKR', '공허지배자 이븐셰이드', '', '', '', '', '', '', '', '', 35435),
(54387, 'koKR', '어둠해안 기부: 피로 물든 뼈', '보랄러스 항구에 있는 마이 와글완드를 위해 반지 마법부여 - 유연성의 문장 $1oa개를 모아야 합니다.', '', '', '', '', '', '', '', 35435),
(54386, 'koKR', '어둠해안 기부: 심해 붕대', '보랄러스 항구에 있는 노버 토글스프로켓을 위해 갑툭튀탄 $1oa개를 모아야 합니다.', '전장에서 크게 한방을 터뜨려야 할 때가 언제인지는 아무도 예상하지 못해요. 하지만 우리는 예상하지 못한 상황을 대비할 수 있죠!\n\n우리의 의지를 제대로 보여주려니, 뭔가 살짝 부족할 때가 있잖아요. 그런 때를 대비해서 특별한 폭발물을 모으기 시작했는데, 그중에 추가한 물건이 있어요.\n\n여분의 폭탄이 있으시다면, 꼭 유용하게 쓰이도록 할게요.', '', '', '', '', '', '', 35435),
(54383, 'koKR', '어둠해안 기부: 번득비늘 잠수복', '보랄러스 항구에 있는 노버 토글스프로켓을 위해 냉기 어린 탄약 $1oa개를 모아야 합니다.', '안녕하세요!\n\n저 높은 곳에서 보낸 교신이 도착했어요. 탄약이 더 필요해요! 특별한 탄약 말이에요. 아무도 예상하지 못한 그런 탄약!\n\n소문을 듣자 하니 아주 노련한 기술자만 만들 수 있는 냉기 서린 탄약이 있다는군요. 그 탄약을 조금만 구해주신다면 탄약 장교가 정말 기뻐할 거예요!\n\n어쩌면, 제게 연구용으로 하나 남겨줄지도 몰라요!', '', '', '', '', '', '', 35435),
(54380, 'koKR', '어둠해안 기부: 금화', '보랄러스 항구에 있는 경리 볼드렌에게 $1oa골드를 기부해야 합니다.', '저희는 엄청난 시간과 자원을 쏟아부어 전쟁에 대비하고 있습니다.\n\n최종 준비 단계에 접어들었으니, 앞으로 있을 훈련과 언제든 쓸 수 있는 보급품 마련에 필요한 추가 자금을 확보하려 합니다.\n\n기부 좀 해주시겠습니까?', '', '', '', '', '', '', 35435),
(54376, 'koKR', '어둠해안 기부: 원기회복의 물약', '보랄러스 항구에 있는 랴오를 위해 전투의 외침의 전쟁 두루마리 $1oa개를 모아야 합니다.', '', '', '', '', '', '', '', 35435),
(54369, 'koKR', '어둠해안 기부: 전기 충격 탈것 박차', '보랄러스 항구에 있는 찰레인에게 번득비늘 $1oa개를 기부해야 합니다.', '간단히 말하겠소. 번득비늘이 필요하오!\n\n너무 대놓고 말해서 미안하지만 한시가 급하다오.\n\n혹시라도 여행하다 번득비늘을 찾아 가져다준다면 유용하게 쓰겠소. 병사들에게 장비를 갖춰주는 게 다가올 전쟁을 대비하기 위한 가장 중요한 일 아니겠소?', '', '', '', '', '', '', 35435),
(54366, 'koKR', '어둠해안 기부: 겨울의 입맞춤', '전쟁 깃발: 결사단원의 방어 $1oa개를 모아 보랄러스 항구에 있는 파엘라에게 가져가야 합니다.', '', '', '', '', '', '', '', 35435),
(54363, 'koKR', '어둠해안 기부: 전쟁 자원', '', '', '', '', '', '', '', '', 35435),
(54308, 'koKR', '광산 업무', '', '', '', '', '', '', '', '', 35435),
(54281, 'koKR', '쇠뇌 폭파', '', '', '', '', '', '', '', '', 35435),
(53976, 'koKR', '한아름 가득한 철을', '주위에 있는 광석 상자에서 철을 수집해야 합니다.', '이 정도로는 어림도 없겠어요! 앞으로도 계속 호드와 맞서려면 철을 모아야 해요!\n\n로른스타 폐허로 가서 철을 구해다 주세요. 철이 필요해요!', '', '', '', '', '', '', 35435),
(53974, 'koKR', '그늘파도의 드루이드', '그늘파도 해안을 점령한 다음 에드가드와 대화하여 그가 무엇을 제공하는지 알아봐야 합니다.', '그늘파도 해안에 잠재된 힘 덕분에 우리도 막강한 힘을 손에 넣을 기회가 생겼다. 우리 전력에 어떤 보탬이 될 수 있는지는 에드가드가 해박하게 알고 있지.\n\n그를 찾아 자연의 힘을 알아봐라.', '', '', '', '', '', '', 35435),
(53961, 'koKR', '수리검 작업장으로', '에리온과 대화하여 수리검 작업장에서 무엇을 제공하는지 알아봐야 합니다.', '텔드랏실 방화 사건 이후로 다들 신경이 곤두서있어. 특히 에리온이 마음고생을 많이 했지. 도울 기회가 생기자마자 바로 달려들더군.\n\n가서 한번 얘기해보는 건 어때? 그가 수리검 작업장에서 무슨 일을 하고 있는지도 보고 말이야.', '', '', '', '', '', '', 35435),
(53960, 'koKR', '장로의 제단', '달의 여사제 라사라와 대화하여 장로의 제단에서 무엇을 제공하는지 알아봐야 합니다.', '전면적인 지원 덕에 장로의 제단을 다시 세울 수 있었네요.\n\n가서 달의 여사제 라사라 님과 얘기를 나눠보세요. 제단에서 제공하는 게 뭔지 알 수 있을 거예요.', '', '', '', '', '', '', 35435),
(53959, 'koKR', '군대를 위한 장비', '코드레사 브라이어보우와 대화하여 사냥꾼의 전당이 무엇을 제공하는지 알아봐야 합니다.', '호드와 맞서는 병사들에게 가능한 최고의 장비를 지급해야 합니다.\n\n사냥꾼의 전당이 완성되는 대로 코드레사 브라이어보우에게 말을 걸어 우리 병력의 무기와 방어구를 개량할 방안을 알아보세요.', '', '', '', '', '', '', 35435),
(53957, 'koKR', '어둠해안 신병', '전쟁의 고대정령을 복구하고 제로드 섀도송과 대화하여 아군을 영입해야 합니다.', '어둠해안 탈환에 보탬이 될만한 신병이 몇 명 들어왔어요!\n\n다만 우선은 전쟁의 고대정령을 회복시켜야 해요. 자원을 기여해주시면 고대정령도 금방 기운을 차릴 거예요!\n\n전쟁의 고대정령이 회복되면 제로드 섀도송 님께 알려 병력을 모집하세요. 그대 곁에서 싸우면 신병들이 많은 경험을 쌓을 수 있을 테죠.', '', '', '', '', '', '', 35435),
