(53366, 'koKR', '아라시 기부: 전쟁 깃발: 신속한 집결', '전쟁 깃발: 결사단원의 방어 $1oa개를 모아 보랄러스 항구에 있는 파엘라에게 가져가야 합니다.', '', '', '', '', '', '', '', 35435),
(53334, 'koKR', '아라시 기부: 전쟁 자원', '', '', '', '', '', '', '', '', 35435),
