(53265, 'koKR', '아라시 기부: 금화', '보랄러스 항구에 있는 경리 볼드렌에게 $1oa골드를 기부해야 합니다.', '저희는 엄청난 시간과 자원을 쏟아부어 전쟁에 대비하고 있습니다.\n\n최종 준비 단계에 접어들었으니, 앞으로 있을 훈련과 언제든 쓸 수 있는 보급품 마련에 필요한 추가 자금을 확보하려 합니다.\n\n기부 좀 해 주시겠습니까?', '', '', '', '', '', '', 35435),
(53237, 'koKR', '아라시 기부: 전투의 외침의 전쟁 두루마리', '보랄러스 항구에 있는 랴오를 위해 전투의 외침의 전쟁 두루마리 $1oa개를 모아야 합니다.', '', '', '', '', '', '', '', 35435),
(53236, 'koKR', '아라시 기부: 인내의 전쟁 두루마리', '보랄러스 항구에 있는 랴오를 위해 인내의 전쟁 두루마리 $1oa개를 모아야 합니다.', '', '', '', '', '', '', '', 35435),
(53231, 'koKR', '아라시 기부: 어스름 가루', '보랄러스 항구에 있는 마이 와글완드를 위해 무기 마법부여 - 강인한 항해 $1oa개를 모아야 합니다.', '', '', '', '', '', '', '', 35435),
(53218, 'koKR', '아라시 기부: 모네라이트로 굳힌 발굽보호대', '보랄러스 항구에 있는 브랜달 다크비어드를 위해 모네라이트로 굳힌 발굽보호대 $1oa개를 모아야 합니다.', '어느 쪽이 가장 좋은 방어구나 가장 날카로운 검을 가졌는지가 전쟁의 승패를 결정하지는 않지만, 도움이 되기는 하죠! 사실, 동맹군뿐만 아니라 우리 야수들도 방어구와 무기가 필요해요.\n\n용감한 야수들에게 발굽보호대를 가져다주신다면, 분명 야수 담당 부사관들이 유용하게 쓸 거예요.', '', '', '', '', '', '', 35435),
(53217, 'koKR', '아라시 기부: 거친 가죽 마갑', '보랄러스 항구에 있는 찰레인을 위해 거친 가죽 마갑 $1oa개를 모아야 합니다.', '다가올 전쟁에서 병사만 보호해야 하는 것은 아니오. 말도 보호해야 하오.\n\n우리 말이 그나마 가장 괜찮은 보호구를 장착하고 전쟁에 나설 수 있도록 도와주겠소?', '', '', '', '', '', '', 35435),
(53205, 'koKR', '아라시 기부: 모네라이트 광석', '보랄러스 항구에 있는 브랜달 다크비어드를 위해 모네라이트 광석 $1oa개를 모아야 합니다.', '이 근처에서 광석을 잔뜩 지고 돌아다닐 친구처럼 보이는군요! 제 생각이 맞는다면, 전쟁 물자를 보충할 광석을 모아달라고 부탁하고 싶군요.\n\n광석을 좀 가져다줄래요?', '', '', '', '', '', '', 35435),
(53195, 'koKR', '아라시 기부: 아쿤다의 이빨', '보랄러스 항구에 있는 첼시 스트랜드를 위해 세이렌의 꽃가루 $1oa개를 모아야 합니다.', '안녕하세요!\n\n전쟁 보급품 지원이 한창이고 저는 약초와 연금술을 담당할 거예요. 만나서 정말 반가워요!\n\n자, 어디 보자... 아, 맞아. 세이렌의 꽃가루. 어젯밤부터 세이렌의 꽃가루 비축량이 충분하지 않은 것 같아요. 전쟁 지원 활동에 동참해 주시면 정말 큰 도움이 될 거에요.', '', '', '', '', '', '', 35435),
