(49376, 'koKR', '딱 한 가지 더', '새끼 크로그를 잡아야 합니다.', '다음은 제 피를 볼 차례였는데, 마침 잘 오셨습니다!\n\n저희가 이곳에 멈추게 된 건 모두 제 잘못입니다. 우리 팀은 돌아가길 원했거든요.\n\n아시겠지만 크로그는 골칫덩이입니다. 피로 인해 태어난 크로그는 사악한 자들의 양육으로 타락합니다. 외부 자극에 약한 녀석들이니 살짝만 꼬드겨면 따라올 겁니다.\n\n근처에 있는 새끼 크로그 한 마리의 주의를 끄십시오. 제 이론이 맞는지 확인해 보겠습니다.', '', '', '', '', '', '', 35435),
(49059, 'koKR', '자이발라의 뼈', '자이발라에서 아카디아 치슬스톤과 만나야 합니다.', '탐험가 연맹의 동맹들이 흥미로운 걸 발견했다는 소식을 전해 왔습니다. 그들은 현재 줄다자르의 자이발라에 초소를 세운 상태라고 합니다.\n\n초소로 이동하여 우리에게 도움이 될 만한 걸 발견할 수 있도록 그들을 도우십시오.', '', '', '', '', '', '', 35435),
