(32413, 'koKR', '크라사랑으로 귀환', '크라사랑 밀림의 지배령 거점에 있는 장군 나즈그림에게 보고해야 합니다.', '그대가 가로쉬, 또는 롬매스와 나, 아니면 그 어떤 이에게 충성심을 보이든 한 가지 확실한 것이 있소. 바로 오늘 그대의 행동은 진정 영웅적이었다는 것 말이오.$b$b그대가 크라사랑 밀림으로 돌아갈 운송 수단은 내가 마련해주겠소. 다시 판다리아로 돌아가려면 내게 이야기하시오.', '', '', '', '', '', '', 35435),
(31719, 'koKR', '기수의 도전: 닝나 다크휠', '닝나 다크휠과 대화하고, 대련에서 승리해야 합니다.', '자네는 잠재력이 아주 대단하군, $n. 하지만 절제과 겸손이 빠진 재능은 별 쓸모가 없지.$B$B오늘은 닝나 다크휠과 대련할 걸세. 그녀의 힘은 날고 긴다는 제자들 중에서도 단연 독보적이지. $B$B자네가 이기고 싶다면 아주 정확한 몸놀림이 필요할 걸세.$B$B원형 훈련장에서 그녀와 대화하고, 자신감 있게 도전해 보게. 행운을 비네.', '', '', '', '', '', '', 35435),
(31717, 'koKR', '기수의 도전: 에이스 롱포우', '에이스 롱포우와 대화하고, 대련에서 승리해야 합니다.', '요즘 우리 제자들 중에서 자네 활약이 아주 뛰어나더군, $n.$B$B검은 뜨거운 불에서 제련해야 하듯이, 단원들도 서로 경쟁하며 실력을 겨루어 보아야 하네.$B$B오늘 가장 뛰어난 제자 중 하나인 에이스 롱포우와 대련할 자리를 마련했네. 그를 이기려면 방어 기술을 잘 활용해야 할걸세.$B$B여기 원형 훈련장에서 그에게 도전하게. 행운을 비네.', '', '', '', '', '', '', 35435),
(31682, 'koKR', '바다 옆에서, 두 번 다시는', '파도에 닳은 바위에 클락시 조율용 굽쇠를 사용해서 용장을 깨워야 합니다.', '이방인이여, 클락시바가 내게 말했다. 용장은 소금물 갯벌에 숨어 있다고, 그러나 그리 깊이 숨어 있지는 않다고 했다.$b$b도마뱀들이 그를 포위하고 있다. 놈들의 비늘 덮인 손에 용장을 죽게 해선 안 된다.$b$b그를 찾아서 깨워다오. 혼자 돌아와서는 안 된다!$b$b이 일을 해내면 클락시가 우리에게 고마워할 것이다.', '', '', '', '', '', '', 35435),
(30739, 'koKR', '엘리아 레이븐메인: 구원', '희망의 단상 꼭대기에 있는 엘리아 레이븐메인을 꺾어야 합니다.', '당신의 적수, 엘리아 레이븐메인이 돌아왔습니다. 희망의 단상 꼭대기에서 기다리고 있겠다는군요.$b$b$n, 한 가지 알아둬야 할 것이 있는데... 엘리아에게 끔찍한 일이 일어났습니다. 전혀 다른 존재가 되어버렸어요. 단상에 가면 무슨 말인지 알 수 있을 겁니다.$b$b행운을 빕니다, $n.', '', '적수가 돌아왔습니다.', '엘리아 레이븐메인', '', '', '', 35435),
(30733, 'koKR', '투카툭', '투카툭을 꺾어야 합니다.', '당신의 이름이 널리 알려지고 있는 모양입니다, $n. 노련한 상대가 도전장을 던졌습니다. 당신이 소문만큼 강하지 않을 거라 여기고 있습니다.$b$b이름은 투카툭이고, 호젠입니다. 호젠과 싸워 본 적이 있다면, 그들이 어려 보이는 모습과 달리 굉장한 싸움꾼이라는 걸 아시겠지요. 행운을 빕니다.', '', '최근 열 번의 대련에서 한 번도 진 적이 없다고 합니다.', '투카툭', '', '', '', 35435),
(27064, 'koKR', '그는 뭔가 숨기고 있다', '안두인 린을 호위해 스톰윈드 구 시가지에 있는 SI:7 본부 3층으로 가야 합니다. 왕자와 떨어지면 스톰윈드 왕궁에서 그를 다시 만날 수 있습니다.', '$n 님, 사무엘슨이 의도적으로 우리를 헛고생시키는 것처럼 느껴집니다. 항구 일꾼들은 아무것도 몰라요. 더욱 중요한 건, 스톰윈드 항구에서 폭발물이 없어졌다는 겁니다!$B$B제가 무슨 생각을 하는지 아시겠습니까? 전 사무엘슨이 우리에게 말한 것보다 더 많은 걸 알고 있다고 확신합니다. 어쩌면 황혼의 망치단 우두머리의 정체를 이미 파악했는데 공을 나누기 싫어서 그러는지도 모르지요.$B$BSI:7 본부에서 그의 서류를 살펴봐야 합니다. 저와 함께 거기 가면, 사무엘슨의 서류를 살펴보고 그가 진정 무엇을 알고 있는지 찾아낼 수 있을 겁니다.', '', '', '', '', '', '', 35435),
(27044, 'koKR', '농부의 문제', '안두인 린 왕자를 호위해 스톰윈드의 월러튼 농장에 있는 농부 월러튼에게 가야 합니다. 왕자와 떨어지면 스톰윈드 왕궁에서 그를 다시 만날 수 있습니다.', '전 아직 왕궁으로 돌아갈 준비가 안 됐습니다. 절 도와주시겠습니까?$B$B최근 이 지역 농부 몇 명이 가축이 없어졌다고 폐하께 청원을 올렸습니다. 아버지께서는 조사할 사람을 보내겠다고 약속하셨지만, 지금은 도시 경비로 정신없는 시기라 약속을 지키려면 몇 주가 걸릴 겁니다.$B$B그래서 제가 도우면 되겠다고 생각했지요! 누군가가, 그것도 왕가의 핏줄이 조사에 착수한다면 농부들의 사기가 오를 겁니다. 게다가 겨우 소 몇 마리 없어진 사건이니 위험할 리도 없고요.$B$B이 도시 안에 있는 농부 월러튼에게 좀 데려가 주세요!', '농부 월러튼이 있는 곳까지 안두인 린 왕자를 호위', '', '', '', '', '', 35435),
(26974, 'koKR', '거짓된 용사', '헤로드를 처치해야 합니다.', '우리... 우리는... 놈들을 처치해야만 했어요! 놈들이 우릴 노리고 있었단 말입니다!$B$B당신... 당신만은 저를 믿어 주시겠지요?$B$B붉은십자군의 진정한 용사는 헤로드가 아닙니다! 바로 접니다! 원래 내 것이었던 자리를 헤로드가 빼았았을 뿐입니다!$B$B당신... 당신이 그를 처치하셔야 합니다. 그... 그는 붉은십자군을 위협하는 존재일 뿐입니다!$B$B물론 보상은 든든하게 해 드리지요...', '', '더러운 도둑!', '헤로드', '', '', '', 35435),
(25446, 'koKR', '개구리 투하!', '박쥐를 타고 가는 동안 개구리 자루에 있는 주문에 걸린 개구리 12마리를 메아리 섬에 표시된 지역에 던져 넣어야 합니다.', '개구리가 준비됐으니, 이제 이걸 섬으로 보내게 도와주세요.$B$B센진 마을에서 동쪽으로 가면 조련사 만렉을 만날 수 있을 거예요. 만렉은 볼진 정찰대가 사용하는 모든 박쥐를 관리하고 있으니까 메아리 섬에 갈 박쥐를 빌릴 수 있을 거예요.$B$B이 개구리 자루를 가지고 가세요. 정령들의 가호를 요청했더니 제 눈으로 봐야 할 곳을 그대에게 보여주려고 연기를 보내 줬어요. 박쥐를 타고 가는 동안 자루 안의 개구리를 꺼내 그 연기 안으로 던져 넣으면 돼요.', '', '', '', '', '', '', 35435),
(24829, 'koKR', '파괴의 길', '', '', '', '', '', '', '', '', 35435),
(24651, 'koKR', '왕관사 무너뜨리기', '샤트라스 동쪽의 테로카르 숲에 있는 왕관 청부업자 5명을 처치하고 스내글볼트의 코륨 폭탄으로 화학약품 수레 하나를 파괴한 후 오그리마에 있는 명탐정 스냅 스내글볼트에게 가야 합니다.', '이 장부엔 위치가 가득 표시되어 있군. 이봐, 자네가 이 기록을 조사하고 조치를 해줬으면 해. 더는 이 일을 질질 끌 순 없어.$b$b내가 말한 곳을 조사해줘. 테로카르 숲에 있는 샤트라스의 동쪽으로 보이는군. 얼른 가서 놈들에게 본보기를 보여줘.$b$b아, 그리고 만약 크고 위험해 보여서 파괴해야 할 것 같은 무언가를 발견하면 이 폭탄을 던지라고.', '', '', '', '', '', '', 35435),
(13795, 'koKR', '크록 스컬지베인', '은빛십자군 마상시합 광장에 있는 크록 스컬지베인과 대화해야 합니다.', '칠흑의 기사단 대표자들의 지도자께서 당신과 이야기를 나누고자 청하셨습니다, $c|1이여;여;. 크록 스컬지베인 님께서는 더할 나위 없이 무시무시한 전투원이시며, 그분께서 당신에게 요청하실 게 많으시리라 확신합니다.$B$B칠흑의 기사단에 속한 기사들이 얼라이언스 대표자들이 있는 천막의 서쪽, 마상시합 광장의 북쪽에 야영지를 마련했으니 그리로 가 보십시오.', '', '', '', '', '', '', 35435),
(13685, 'koKR', '아이언포지 용맹전사', '아이언포지 용맹전사가 되려면 은빛십자군 마상시합 광장에 있는 라나 스타우트해머와 대화해야 합니다.', '아이언포지의 깃발을 걸고 시합에 나가 싸울 자격이 있는 존재임을 스스로 입증하셨군요, $n 님. 이제, 아이언포지 대표단을 이끄는 라나 스타우트해머 님께 자기소개를 하셔야겠습니다. 아이언포지 최고 용사로서, 그대를 도시 대표로 마상시합에 참가시키고, 용맹전사로 받는 훈련과 시험을 감독하실 분입니다.$B$B함께할 수 있어서 영광이었습니다, $n 님. 그리고 앞으로 마상시합을 치를 때 행운이 깃들기를 빕니다.', '', '', '', '', '', '', 35435),
(12480, 'koKR', '노스렌드를 향하여!', '북풍의 땅에 있는 전쟁노래 요새나 울부짖는 협만에 있는 복수의 상륙지로 가서 호드 징병관과 대화해야 합니다.', '\'리치 왕의 분노 친구와 가족 알파 테스트\'에 참여한 당신을 환영하는 바이오. 내 옆에 있는 차원문을 통해 노스렌드로 여정을 떠날 수 있소.$B$B북풍의 땅에 있는 전쟁노래 요새나 울부짖는 협만에 있는 복수의 상륙지 중 한 곳으로 가서 호드 징병관에게 보고하시오.', '', '', '', '', '', '', 35435),
(11124, 'koKR', '[DEPRECATED]Inspecting the Ruins', 'Investigate the Shady Rest Inn in at the border of the Barrens in Dustwallow Marsh.', 'If you follow the road south from the village, and then west toward the Barrens, you\'ll come across the ruins of the Shady Rest Inn.$B$BTheramore has sent an investigator to discover how the inn met its fate. I had a man placed in that inn as a spy and I don\'t trust in the competence of these humans to uncover what happened.$B$BWhatever you find, don\'t give a scrap of it to that investigator. We\'ll handle this ourselves.', '', '', '', '', '', '', 35435),
(10943, 'koKR', '어린이 주간', '드레나이 고아 호루라기를 사용하여 어린이 주간 동안 돌볼 고아를 불러야 합니다.', '요즘과 같은 어린이 주간에 한 특별한 여자아이가 얼마 동안이라도 자네를 친구로 삼으면 매우 기뻐할 걸세.$B$B자, 이 호루라기를 받게나. 이 호루라기를 사용하면 자네가 후원하기로 한 아이를 부를 수 있게 된다네. 사실 이 호루라기는 어린이 주간이 실시되는 제한된 기간 동안만 유지된다네.$B$B부탁하니 후원하기로 한 아이를 만나 주게. 그 아이가 자네를 만나면 정말 행복해 할 것임은 물론이고 아이에게 도시를 벗어난 모험을 떠날 기회를 줄 수 있는 걸세!', '', '', '', '', '', '', 35435),
(10882, 'koKR', '파멸의 전조', '폭풍우 요새의 알카트라즈로 가서 선구자 스키리스를 처치해야 합니다. 일을 마친 후 샤트라스의 빛의 정원에 있는 아달에게 돌아가십시오.', '<뭔가 이상한 느낌이 드는 아달의 목소리>$B$B캘타스 왕자가 교도관을 잘못 뽑는 바람에 현재 우리가 알카트라즈에 가둬 놓은 죄수들이 탈출하고 있소.$B$B특히 그중 선구자 스키리스라는 고대 신의 부하는 자신의 주인이 우주를 지배하게 하려는 야망을 품고 있다고 하오.$B$B$n, 녀석이 탈출하지 못하도록 막아야 하오. 폭풍우 요새로 돌아가시오. 알카트라즈로 들어가 선구자 스키리스를 처치하시오. 너무 늦기 전에!', '', '', '', '', '', '', 35435),
(10815, 'koKR', '발자레크의 일지: 전쟁의 전조', '붉은 감시초소에서 샤타르의 고위사령관인 마르커스 오랄리온을 찾아야 합니다.', '이 일지에는 최근 일리단 군대의 동태가 자세히 나와 있습니다. 발자레크가 정복의 길을 누비고 다녔던 이유도 적혀 있습니다. 샤타르의 고위사령관을 사로잡는 임무를 개인적으로 맡았던 것으로 보입니다.$B$B그 고위사령관은 정복의 길에서 남쪽 끝에 있는 붉은 감시초소라는 초소에 잡혀 있다고 합니다. 그를 감금한 것은 스스로 붉은 인장대라고 부르는 수상쩍은 진영으로 추정됩니다. 자세히 조사를 하고 싶다면 같은 편을 데려가는 것이 현명한 판단입니다.', '', '', '', '', '', '', 35435),
(10070, 'koKR', '고정 사격', '3 레벨에 도달하여 고정 사격 기술을 습득하고, 태양 첨탑 밖에 있는 훈련용 허수아비를 찾아 고정 사격을 5번 사용해야 합니다.', '이제 첫 번째 수업을 시작해야 할 때로군요.$B$B시간이 지나 실력이 늘면, 자연스럽게 새로운 기술을 발견하실 수 있을 겁니다.$B$B자, 가서 경험을 쌓고 첫 번째 새 기술을 배우세요. 새 기술을 익히거든, 훈련용 허수아비를 찾아서 연습해 보세요.', '', '', '', '', '', '', 35435),
(9631, 'koKR', '동료의 도움', '황천의 폭풍의 52번 구역에 있는 칼린나 나스레드에게 그을린 뼈 조각을 가져가야 합니다.', '아, 내가 사소한 사실을 하나 깜박했구려. 이 뼈 조각에 남아 있는 메디브의 정수에는 마치 아케나고스처럼 생명력이 전혀 없소이다.$B$B하지만 방법이 하나 있소. 내가 우리를 도와줄 만한 자를 알고 있소이다.$B$B황천의 폭풍의 52번 구역으로 가서 칼린나 나스레드에게 이 뼈 조각을 보여 주시오. 그녀라면 뭘 해야 할지 알고 있을 거라 믿소이다.', '', '', '', '', '', '', 35435),
(9608, 'koKR', 'Heart of Rage', 'Fully investigate the Blood Furnace and then report to Nazgrel at Thrallmar in Hellfire Peninsula.', '$C, you must gather a group to investigate the Blood Furnace inside Hellfire Citadel at once!$B$BThe magical scrying that we have at our disposal indicates that something unnatural is occurring in there.  But a powerful force inside is blocking any detailed arcane investigations, so it must be very important.$B$BYou should expect heavy resistance - no other mission that we\'ve sent in there has ever returned!$B$BScout it entirely and then report back to Nazgrel, advisor to Thrall, with what you witness.', 'Fully Investigate The Blood Furnace', '', '', '', '', '', 35435),
(9590, 'koKR', 'The Blood is Life', 'Collect 10 Fel Orc Blood Vials and return them to Centurion Caza\'rez at Thrallmar in Hellfire Peninsula.', 'That letter is disturbing, and not just because it comes from the Betrayer.  We must know how they are creating these new fel orcs if we\'re to defeat them!  It\'s bad enough that we must fight the Burning Legion on our eastern flank, but now a new army of fel orcs to the west!$B$BYou must infiltrate this Blood Furnace inside Hellfire Citadel.  Bring back samples of blood from the fel orcs that you find in there.', '', '', '', '', '', '', 35435),
(8799, 'koKR', '오늘의 영웅', '호랑가시나무 보존기에 깊은바위 소금 한 줌과 5골드를 넣으면 보존된 호랑가시나무를 받게 될 것입니다.', '흠, 내가 이런 비밀을 자네에게 밝히리라고는 생각지도 않았는데... 그래도 자네가 바로 오늘의 영웅이니까!$B$B매년 이맘때쯤엔 어디서나 싱싱한 호랑가시나무를 볼 수 있지만 오래가지는 못하지. 굴뚝나무 목장조합에서는 호랑가시나무가 절대 상하지 않도록 보존하는 기계를 이용해서 겨울맞이 축제의 분위기를 살리고 여름내 돈벌이를 한다네!$B$B자네가 요리의 대가라면 보존기를 쓸 수 있게 해주지. 단, 깊은바위 소금이 필요할 거야. 그리고 사용료는 1, 2, 3... 5골드로 하지. 아주 싱싱하게 보존된 호랑가시나무 한 묶음을 얻을 수 있을 걸세.', '', '', '', '', '', '', 35435),
(8250, 'koKR', '마법 공예', '대마법사 실렘을 만나기 위한 허가를 얻기 위해 사나스 임요를 찾아야 합니다.', '대마법사 실렘이 최근 당신과 같이 경험이 풍부한 자를 찾고 있었소이다.$b$b그를 찾을 생각이라면 아즈샤라로 가면 될 것이오. 그의 탑은 절벽 꼭대기에 있고 그리로 올라갈 방법은 대마법사의 거만한 하인이 시전하는 순간이동으로만 가능하오이다.$b$b사나스는 대마법사의 탑 아래 야영지를 꾸리고 있지. 그를 찾으려면 아즈샤라의 큰길로 가서 엘다라스 폐허의 입구에 갈림길로 가면 되오. 그곳에서 절벽이 나올 때까지 쭉 북쪽으로 가시오.', '', '', '', '', '', '', 35435),
(7361, 'koKR', '검은창 부족의 호의', '알터랙 계곡에 있는 얼라이언스 진영의 나이트 엘프 플레이어를 쓰러뜨리라는 임무를 받았습니다.$B$B나이트 엘프를 처치하고 서리늑대 요새에 있는 나자크 헥센에게 나이트 엘프 머리카락을 가져가야 합니다.', '<이빨을 갈며 분을 삭이는 나자크>$B$B우리 트롤은 나이트 엘프들이 이 세계에 존재하기 전부터 있었어. 사실 나이트 엘프들도 우리에게서 나온 종족이라고...$B$B그런데 우리에게 이런 반역적인 공격을 해오다니 용서할 수 없어! 스태그헬름 녀석은 우리 트롤의 뿌리를 뽑아버리려 하지. 자기 종족을 이 세상에 있게 해준 우리를 흔적까지 없애려 한단 말일세. 그건 절대로 있어서는 안 될 일이지 않은가?!$B$B나이트 엘프를 하나씩 처치할 때마다 우리 검은창 부족의 호의를 살 수 있도록 이 나자크가 도와주겠네. 자네의 업적에 대한 소문이 칼림도어, 아니 동부 왕국 전체에 퍼질 거야. 어서 가서 우리 검은창 부족을 도와 줘!', '', '', '', '', '', '', 35435),
(7172, 'koKR', '지휘의 눈', '', '', '', '', '', '', '', '', 35435),
(6605, 'koKR', 'A Strange One', 'Speak with Winna Hazzard in Felwood.', 'I just got back from Felwood, $n. On my way through, I stopped at Bloodvenom Post and I met a very odd character... She seemed intent on one thing, and I suppose I could tell you what that is, but I think she\'d like to explain it to you herself.$B$BIf you\'re interested, head to Bloodvenom Post in western Felwood and look for Winna Hazzard.$B$BWho knows, she might need your help...', '', '', '', '', '', '', 35435),
(6030, 'koKR', '공작 니콜라스 즈바른호프', '동부 역병지대 희망의 빛 예배당에 있는 공작 니콜라스 즈바른호프에게 \"영적인 대화에 대한 논문\"이라는 책을 전해야 합니다.', '엄브런스라는 저자가 은빛 여명회에 은둔의 영매라는 대단한 문학 작품을 주었소. 뭔가 잔뜩 쓰여 있는 엄청난 분량이었는데. 그렇게 많은 양은 태어나서 처음 봤소이다. 그런데 당최 읽을 수가 있어야 말이지...$B$B은빛 여명회의 가장 존경받는 지도자인 니콜라스 즈바른호프 공작께서는 외국어에 능통하시다오. 이걸 공작께 전해 주시겠소? 물론 보상을 하겠소. 공작께서는 지금 동부 역병지대 동쪽 끄트머리에 있는 희망의 빛 예배당에 계신다오.', '', '', '', '', '', '', 35435),
(6029, 'koKR', 'The Everlook Report', 'Deliver the Everlook Report to Argent Officer Garush at the Bulwark, Western Plaguelands.', 'I\'m looking for a responsible individual to aid me in a small but nonetheless important matter.  I\'m here as a representative of the Argent Dawn\'s interests to the local governance of Everlook.  I need to get a progress report to Argent Officer Garush at the Bulwark; it\'s a ways from here, located along the western fringe of the Western Plaguelands, east of Tirisfal Glades.$B$BIf I may be so bold - this would be a perfect means to introduce yourself to my superior and perhaps earn some work from him!', '', '', '', '', '', '', 35435),
(5382, 'koKR', '도살자, 테올렌 크라스티노브', '스칼로맨스 내에서 의사 테올렌 크라스티노브를 찾아 처치한 후 에바 사크호프의 유해와 루시앙 사크호프의 유해를 불태우십시오. 임무를 완수하면 에바 사크호프에게 가야 합니다.', '크라스티노브는 수천 명을 죽인 살인자예요. 벌 받아 마땅한 자이니 녀석에게 정의의 처단을 내려야만 해요.$B$B녀석을 찾아 수없이 많은 무고한 생명에게 가한 고통을 그대로 되돌려주세요. 녀석을 처치한 후 우리의 시체를 불태워 주세요. 잿더미로 만들어 버리는 겁니다.', '', '', '', '', '', '', 35435),
(5249, 'koKR', '[재사용]여명의 설원으로!', '여명의 설원에 있는 별똥별 마을에서 윈드 나이트체이서와 대화해야 합니다.', '여기서 북쪽으로 여명의 설원에 가면 고대 엘프 유적지가 여러 군데 있어요. 혹독한 땅이지만 여러 가지 비밀을 캐내기 위해 탐험을 해볼 만한 곳이죠.$B$B저는 악령숲에서 할 일이 너무 많아 여명의 설원에 갈 기회가 없었지만... 그대가 가보는 건 어떨까요?$B$B그곳에 가면 윈드 나이트체이서를 찾으세요. 별똥별 마을에서 주로 시간을 보내는데, 그 지역에 대해서 아주 훤히 꿰고 있죠.', '', '', '', '', '', '', 35435),
(4441, 'koKR', '저주받은 고대 수호자', '다르나서스에 있는 달의 신전으로 가서 에리단의 유리병을 사용하여 축복받은 물을 담아야 합니다. 꽉 찬 물병을 에리단에게 가져가야 합니다.', '당신이 발견한 그 플룻은 고대 수호자의 뼈를 깎아 만든 거요. 고대 수호자는 나이트 엘프족을 충실히 지켜온 나무정령들이지.$B$B그런데 눈에 보이는 모든 것에 저주를 내리는 사티로스가 그 고대 수호자들에게도 저주를 내려 악령숲을 빼앗아 버렸소. 저주받은 고대 정령들은 사악한 저주에 의해 영원히 고통에서 해방될 수 없게 되었소. 당신이 발견한 악마매듭도 분명히 관련이 있소.$B$B우리가 플룻을 정화해야 하오. 다르나서스에 있는 달의 신전에서 축복받은 물을 가져다주시오.', '', '', '', '', '', '', 35435),
(4241, 'koKR', '치안대장 윈저', '북서쪽에 있는 검은바위 산으로 가서 검은바위 나락으로 들어가십시오. 치안대장 윈저에게 무슨 일이 있었는지 알아내야 합니다.$B$B털보 존은 윈저가 감옥으로 끌려갔다고 했습니다.', '그러니까 아무짝에도 쓸모없는 그 겁쟁이 녀석이 윈저 님께서 아직 살아계신다고 했단 말이오?$B$B준비하시오, 부관 대리. 당신이 윈저 님을 찾아야 하오. 윈저 님께서 살아계신다면 당신이 구출해오고, 죽었다면 증거를 가져오시오.$B$B<웃는 맥스웰>$B$B이 말을 듣는 것도 이젠 지겹지 않소?', '', '', '', '', '', '', 35435),
(4136, 'koKR', '리블리 스크류스피곳', '리블리를 처치하고 그 증거로 그의 머리카락을 불타는 평원에 있는 유카 스크류스피곳에게 가져가야 합니다.', '동생인 리블리는 가족에게 언제나 골칫덩어리였어요. 무슨 계획에 투자한답시고 걸핏하면 집안의 돈을 가져다 날려버리곤 했죠.$B$B그중에서도 마지막 계획이 제일 심했어요. 무법항의 레빌가즈 남작이 불쌍한 리블리에게 현상금을 걸었으니 말이에요. 스크류스피곳 가문에는 경사가 난 거죠! 우리의 꼬마 리블리가 마침내 무언가 가치 있는 존재가 되는구나 하고 말이에요!$B$B그런데 지금 리블리는 검은바위 나락 어딘가에 숨어버렸어요. 부디 리블리를 찾아서 데려와 주세요!$B$B순순히 오지 않으려고 해도 상관없으니 머리카락이라도 가져오시면 돼요.', '', '', '', '', '', '', 35435),
(3783, 'koKR', '깜짝 기계설인 대작전', '두꺼운 설인 모피 10개를 모아 눈망루 마을에 있는 우미 럼플스니커에게 가져가야 합니다.', '언제나 친구들이 먼저 기발한 아이디어를 생각해내곤 해서 저는 절대로 따라갈 수 없을 거라고 생각했거든요... 하지만 오늘은 달라요! 아주 멋진 계획을 짜냈거든요! 아무한테도 말하지 않겠다고 약속을 해주시면 그 비밀을 살짝 가르쳐 드릴게요...$B$B바로 기계설인을 만드는 거예요! 친구들이 보면 처음에는 무진장 겁을 먹을 거고, 기계라는 것을 알면 아주 놀랄 거예요!$B$B먼저 얼음엉겅퀴설인에게서 두꺼운 설인 모피를 구해야 하는데, 도와주시겠어요? 남동쪽으로 가보면 설인들이 있답니다.', '', '', '', '', '', '', 35435),
(3521, 'koKR', '이베론을 위한 해독제', '히아신스 버섯 7개, 달봉오리 백합 4개, 나무그물거미 영액 1개를 수집해야 합니다.', '제 친구 이베론이 정말 걱정돼요. 거의 하루 동안이나 돌아오지 않는 걸 보니 아무래도 독에 중독되었거나... 아니면 그것보다 더 무서운 일을 당한 게 아닌지 모르겠어요.$B$B만약을 위해 거미 독을 치료할 해독제를 만들어야겠는데 당신이 그 재료를 모아와 주었으면 좋겠어요. 우선 히아신스 버섯이 필요해요. 나무 밑에서 자라니까 쉽게 찾을 수 있을 거예요. 그리고 달봉오리 백합도 필요한데 이건 물웅덩이 근처에서만 자라죠. 또 북쪽의 거미들에게서 나무그물거미 영액도 구해와야 해요.$B$B이베론이 독에 중독되었다고 해도 이것들을 섞어서 해독제로 사용하면 충분할 거예요. 그는 북쪽의 그늘 거미굴로 향했으니 거기서 그를 찾았으면 좋겠군요.', '', '', '', '', '', '', 35435),
(3445, 'koKR', '가라앉은 사원', '타나리스에서 마본 리벳시커를 찾아야 합니다.', '전에 땅속 깊은 곳에 있는 어떤 장소에 대해 들은 적이 있어요. 지금까지 내가 보지 못했던 강력한 존재들에 의해 버려졌다고 해요.$B$B가라앉은 사원이라고 불리는 이곳에 대해 더 알고 싶으면 마본 리벳시커라는 고블린을 찾아가보세요. 나나 트로야스처럼 그 친구도 이 세계의 수많은 고대 유적지를 조사했답니다. 그 친구가 타나리스의 트롤 유적지를 조사하려고 톱니항의 집을 떠났다는 게 가장 최근에 들은 소식이에요.$B$B그 친구 소식이 끊어진 지 꽤 됐지만 찾을 수 있길 바랄게요.', '', '', '', '', '', '', 35435),
(3103, 'koKR', '성스러운 편지', '성스러운 편지를 읽고 북녘골 수도원에 있는 여사제 아네타와 대화해야 합니다.', '당신이 검은바위 첩보원들을 처리하고 돌아오자마자 이 상형 문자로 된 편지를 전해 달라는 부탁을 받았습니다. 이 편지는 상급 사제인 여사제 아네타의 인장이 찍힌 것으로 보입니다. 수도원 내에서 다른 볼일을 보러 가기 전에 어서 편지를 읽어 보는 게 좋겠습니다.', '', '여사제 아네타는 치안대장 맥브라이드의 바로 뒤편, 북녘골 수도원 내의 서재 1층에서 찾을 수 있습니다.', '여사제 아네타', '', '', '', 35435),
(2937, 'koKR', '샤드라 소환', '샤드라알로 제단에서 샤드라를 물리친 후, 그녀의 독을 타렌 제분소에 있는 연금술사 라이던에게 가져가야 합니다.', '이 양피지를 받게. 동부 내륙지에 있는 마른나무껍질 영토 깊숙이에 있는 샤드라알로 제단에서 이걸 읽으면 거미 신 샤드라가 소환될 걸세.', '', '', '', '', '', '', 35435),
(2856, 'koKR', '야생 가죽 조끼', '모자케 야영지에 있는 장도르 스위프트스트라이더에게 거북 껍질 가슴보호갑 2개, 거북 껍질 장갑 2개, 야생덩굴 1개를 가져가야 합니다.', '야생 가죽 조끼는 모든 야생 가죽 방어구 세트의 기본이지. 조끼의 틀과 야생덩굴이 한데 잘 엮여 조끼 전체에 강력한 마법이 흐르게 되기 때문에 몸통을 최대한으로 보호할 수 있네.$B$B이 도안을 얻으려면 거북 껍질 가슴보호갑 2개와 거북 껍질 장갑 2개, 야생덩굴 1개가 필요하네. 쉬운 수업은 아니지만 자네 실력이라면 이 정도는 틀림없이 해낼 수 있을 걸세.', '', '', '', '', '', '', 35435),
(2846, 'koKR', '심연의 티아라', '먼지진흙 습지대에 있는 타베사에게 심연의 티아라를 가져가야 합니다.', '오래전에 난 아름다운 보물을 하나 갖고 있었어요. 심연의 티아라라는 물건인데, 아주 아름다울 뿐만 아니라 제대로 사용할 줄 아는 이에게는 엄청난 힘을 주었죠.$B$B그 소문이 유체술사 벨라타의 귀에 들어가자 욕심을 낸 거예요. 그래서 내가 집을 비운 사이에 부하들을 보내 훔쳐 가 버렸어요. 망할 놈의 도둑들 같으니!$B$B내 티아라를 되찾고 싶어요! 타나리스에 있는 트롤 도시, 줄파락에 가서 벨라타를 찾아 그 티아라를 빼앗아 주세요. 그걸 갖다주면 보상을 해 드리겠어요.', '', '', '', '', '', '', 35435),
(2603, 'koKR', '독수리의 면역력', '혈법사 린노어에게 독수리 모래주머니 10개와 칼송곳니하이에나 턱 2개를 가져가야 합니다.', '이 저주받은 땅에서는 정말 죽음이 날개라도 돋친 듯 활개를 치죠. 저는 검은 독수리들이 잔치라도 하듯 죽은 모험가의 시체에 모여 살점을 뜯고 뼈를 쪼아대는 것을 보아왔죠. 때로는 심하게 부패하고 질병으로 뒤덮인 시체를 먹는 것도 보았고요. 그래서 녀석들의 내부 기관이 어떻게 이 땅을 뒤덮은 질병을 견딜 수 있는지 궁금할 수밖에 없답니다.$B$B용맹스러운 $R|1이여;여;, 절 도와주세요!! 제 연구에는 모래주머니가 필요해요! 물약의 기본 재료인 칼송곳니하이에나 턱도 두 개 있어야 해요.$B$B부탁한 물건을 가져오면 두 배로 보답해 드리겠어요.', '', '', '', '', '', '', 35435),
(2160, 'koKR', '탄노크에게 보급품 전달', '카라노스에 있는 탄노크 프로스트해머에게 여관 보급품 상자를 전해야 합니다.', '안녕하세요! 무척 마음씨 좋은 모험가분이신 거 같군요. 혹시 위험을 무릅쓰고 여행을 하실 계획이시라면 카라노스에 있는 여관으로 이 소포를 좀 전해주지 않겠어요?$B$B도착하면 그 여관에서 좀 머무는 것도 좋을 거예요. 먼 길이라 피곤하실 테니까요.$B$B어쨌든, 이걸 여관 종업원 탄노크 프로스트해머에게 가져다주세요. 저는 이곳에서 멀리 갈 수 없는 몸인데다 며칠 후 도착할 산악경비대 호위병을 기다려야 해서 곤란하거든요.', '', '', '', '', '', '', 35435),
(1951, 'koKR', '마력의 의식', '먼지진흙 습지대에 있는 타베사에게 마력의 의식을 가져가야 합니다.', '흠... 지금 생각해보니 책이 없군! 그렇지... 전에 노름으로 진 빚이 있어 그걸 갚느라 마지막 마력의 의식 사본을 성직자 친구에게 팔아버렸지...$B$B그 친구 붉은십자군의 일원이었는데 분명히 티리스팔 숲에 있는 붉은십자군 수도원의 도서관으로 가지고 갔을 게야!$B$B그 책을 원한다면 그 수도원으로 가서 찾아야 할 거라고. 수고를 끼쳐 미안하군그래. 요즘 제정신이 아니라서...', '', '', '', '', '', '', 35435),
(1948, 'koKR', '강력한 물건', '먼지진흙 습지대에 있는 타베사에게 비취 1개와 벼락 맞은 나뭇가지를 가져가야 합니다.', '마법사의 지팡이를 만드는 건 쉬운 일이 아니죠. 다량의 희귀한 재료가 필요하고 많은 양의 마법력을 담을 수 있는 용기도 만들어야 한답니다. 이런 것들을 모아서 내게 가져오도록 하세요.$B$B이 양피지에 필요한 물건의 이름과 구하는 방법을 적어놓았어요. 이 목록에 적은 물건들을 그대로 가져오고 지시사항도 반드시 따르도록 하세요. 그렇지 않으면 지팡이를 만들 때 일이... 잘못될 수도 있으니...', '', '', '', '', '', '', 35435),
(1825, 'koKR', '툰그림과의 대화', '불모의 땅에 있는 툰그림 파이어게이즈와 대화해야 합니다.', '유명한 오크 대장장이인 툰그림 파이어게이즈가 자네가 호드를 위해 열심히 싸워준 얘기를 들었다네. 자네에게 갑옷을 하나 만들어주고 싶으니 즉시 자기를 찾아오라더군.$B$B툰그림은 불모의 땅 십자로 동쪽에 위치한 야영지에 있다네.', '', '', '', '', '', '', 35435),
(1322, 'koKR', '검은 방패', '담쟁이 마을에 있는 도골이 산성 독주머니 5개를 모아 달라고 했습니다.', '흐음, 바로 여기 방패 테두리에 글자가 새겨져 있지만 불에 타서 읽기가 어렵다.$b$b방패를 닦아낼 산성 용액이 필요하다. 암흑안개거미의 독이 용액으로 쓰기에 좋을 거다. 그 거미들은 마을의 북서쪽에 있는 암흑안개 굴이라는 오래된 광산을 점령하고 있다. 녀석들의 독주머니를 구해 오면 방패를 깨끗이 닦아낼 수 있을 거다.', '', '', '', '', '', '', 35435),
(1160, 'koKR', '지혜의 시험', '언데드 위협의 기원을 찾아 언더시티에 있는 파쿠알 핀탈라스에게 가져가야 합니다.', '그럼 자네가 찾아야 할 것을 말해 주지. 질문은 그것을 찾아온 후에 할 거야. 힘보다 지식이 훨씬 중요하지. 세상엔 자네보다 더 뛰어난 능력을 갖춘 이들도 많이 있겠지. 하지만 이 세상에 대한 지식을 쌓아 간다면 그게 훨씬 더 가치 있는 일이야.$B$B티리스팔 숲 북쪽에 있는 수도원으로 가게. 그곳 도서관에는 \'언데드 위협의 기원\'라는 책이 있지. 그 책은 지금은 타락해 버린 성기사들이 우리 종족과 싸우기 위한 훈련에 사용하던 교본일세.$B$B그걸 내게 가져오도록 하게.', '', '', '', '', '', '', 35435),
(1062, 'koKR', '고블린 침략자', '투자개발회사 나무꾼 15명을 처치한 다음 돌발톱 산맥과 불모의 땅의 경계에 있는 시리스 스톤브레이크에게 가야 합니다.', '고블린이 운영하는 투자개발회사가 돌발톱 산맥으로 몰려와 함부로 나무를 베고 숲을 태우고 있어요. 숲의 정령들은 고통과 분노로 눈이 멀 지경이니 투자개발회사를 반드시 막아야 해요!$B$B북서쪽으로 가세요. 큰소나무 계곡 너머 칼바람 바위산까지 말이에요. 고블린과 그 하수인들이 일하고 있을 테니, 녀석들에게 우리 호드가 돌발톱 산맥에서 그들이 행한 악행을 그냥 두고만 보지는 않으리라는 걸 똑똑히 일깨워 줘요. 가장 확실히 깨우칠 수 있는 방법으로...$B$B호드의 힘을 보여줘요!', '', '', '', '', '', '', 35435),
(969, 'koKR', '행운이 함께하기를', '눈망루 마을의 의술사 마우아리에게 서리망치거인조각 4개를 가져가야 합니다.', '허, 자네 눈을 들여다보기만 해도 뭘 원하는지 알 것 같군. 행운 깃든 부적을 만들어 달라는 게지? 말하지 않아도 이 마우아리는 다 안다네!$B$B남쪽으로 가게. 그곳에 가면 얼음으로 만들어진 거인들을 볼 수 있을 게야. 가끔 녀석들이 지니고 다니기도 하고, 아니면 자네가 직접 산맥을 뒤져 조각들을 찾아올 수도 있지. 이곳에서는 질이 아주 좋은 것들이 나오니 말이야...$B$B서리망치거인조각 4개를 가져오면 내 행운 깃든 부적을 자네에게 줌세.', '', '', '', '', '', '', 35435),
(967, 'koKR', '알살락스의 탑', '잿빛 골짜기에 있는 수호자 델그렌에게 발툴의 편지를 전해야 합니다.', '내 스승이신 수호자 델그렌께서는 숲을 악마와 언데드의 손으로부터 지키기 위해 기꺼이 도움을 주고 계신 성기사이시오. 그분은 내게 성스러운 빛과 전투 기술에 대해 많은 걸 가르쳐 주셨다오. 델그렌이시라면 이 집단이 대체 무엇을 하고 있는 건지 바로 알아내실 것이오.$b$b이곳에서 남쪽으로 멀리 떨어진 잿빛 골짜기 숲의 마에스트라 주둔지로 가면 그분을 만날 수 있을 거요. 아... 암흑이교도의 위협이 시시각각으로 커지고 있는 것 같소. 서두르시오.', '', '', '', '', '', '', 35435),
(944, 'koKR', '지배자의 고대검', '정보를 수집한 다음 수정점의 유리병을 사용하여 수정점 그릇을 만들어서 오누와 대화해야 합니다.', '이곳 어둠해안에 나가가 나타났다는 건 이상한 일이 아닐 수 없군. 그런데 더 이상한 건 바로 황혼의 망치단이야. 그 이교도들은 이 땅의 고대 신을 섬기고 있지. 아주 예전에 죽은 지배자를 말이야.$B$B남쪽에 있는 지배자의 고대검은 그 지배자가 전투에서 패배한 장소야. 그곳으로 가서 황혼의 망치단 이교도들이 더 있는지 찾아봐. 참, 이 수정점의 유리병을 가져가야 해. 지배자의 고대검을 찾고 나서 이걸 사용하면 수정점 그릇을 만들 수 있을 거야. 그 그릇을 사용하면 나와 말을 할 수 있지.', '지배자의 고대검 발견', '', '', '', '', '', 35435),
(917, 'koKR', '나무그물거미의 알', '나무그물거미알을 구해야 합니다.', '사실 좀 곰곰이 생각해보니 그대가 저를 조금 더 도와주실 수도 있을 것 같습니다. 나무그늘거미들이 알을 가지고 있지 않은 것 같아 동굴 깊숙한 곳에 있는 그 알을 채취하러 왔으니까요. 저 대신 나무그늘거미의 알을 채취해 디라니아에게 가져다주면 정말 고맙겠습니다.', '', '', '', '', '', '', 35435),
(701, 'koKR', 'Guile of the Raptor', 'Acquire 12 Raptor Hearts from Highland Fleshstalkers for Tor\'gan.', 'With some additional objects, I will be able to create an item that will imbue Gor\'mul with the guile of the raptor! With the power of the raptor flowing through him, Gor\'mul will know our new power and rediscover the warrior that lies dormant!$b$bI will require raptor hearts to fashion the item and spell.', '', '', '', '', '', '', 35435),
(676, 'koKR', '망치 주둔지 함락 위기', '돌주먹 오우거 8마리와 돌주먹 집행자 10마리를 처치한 다음 아라시 고원의 망치 주둔지로 가서 드럼 펠을 찾아야 합니다.', '전부 약해 빠진 놈들뿐이니... 이봐, 뭘 쳐다보는 거요? 당신은 스스로 뭔가 특별하다고 생각하는 모양이군. 그럼 한번 중명해 보시지 그러시오?$B$B아라시의 망치 주둔지 기지가 공격받고 있소. 서둘러 지원군을 보내지 않으면 곧 붕괴하고 말 거요.$B$B하지만 그 전에 우선 당신의 능력을 시험해 보는 게 좋을 거요. 아라시 고원의 스트롬가드 북동쪽에 있는 오우거 고분에 돌주먹 일족이 살고 있소. 그곳의 오우거들과 집행자들을 처치한 후 망치 주둔지에 있는 드럼 펠에게 보고하도록 하시오.', '', '', '', '', '', '', 35435),
(671, 'koKR', 'Foul Magics', 'Get 10 Bloodstone Amulets for Tor\'gan in Hammerfall.', 'I have felt a strangeness in the air... a feeling that simmers in my blood. I had my suspicions. I set off to find the source of my unease and discovered to the west, at Northfold Manor, the residual traces of demonic summoning. As I got close, my blood began to boil and the rage within me grew.$b$bOn the ground I spied an amulet of bloodstone, used to assist in demonic summoning. The one I found was depleted, however. I\'ll need another to examine, but I dare not return to the manor. Can you bring me some?', '', '', '', '', '', '', 35435),
(642, 'koKR', '함정에 빠진 공주', '미즈라엘의 결정 파편을 12개 모아서 마른수염 골짜기에 있는 오색 결정에 가져가야 합니다.', '제 이름은 미즈라엘입니다. 전 대지의 공주인데 거인들이 나를 잡아서 아라시 고원 땅속 깊이 가두어 놓았답니다. 이 수정 결정이 제가 지상 세계와 교신할 수 있는 유일한 수단이에요.$B$B제발 절 도와주세요. 동쪽의 마른수염 골짜기에 있는 동굴에 사는, 거인과 한편인 마른수염 코볼트들에게 이것과 같은 결정이 있어요. 그 결정을 작동시키려면 코볼트들에게서 미즈라엘의 결정 파편을 빼앗아야 합니다.$B$B제발 부탁해요. 절 도와주세요!', '', '', '', '', '', '', 35435),
(565, 'koKR', '바르톨로의 설인 모피 망토', '남녘해안에 있는 바르톨로 진세티에게 양모 두루마리 1개, 산악인의 망토, 가는 실타래, 그리고 설인 모피 10개를 가져가야 합니다.', '나, 위대한 바르톨로가 얼라이언스 내에서 명성이 자자한, 세계적인 설인 모피 망토를 만들어 주겠소!$b$b내 장담하는데, 온 세상을 돌아다녀도 내가 만든 망토만한 건 없을 거요. 오, 뭐라고 했소, 말쑥한 $r 양반? \"바르톨로, 당신 것보다 나은 망토는 어디에도 없소!\"라고 했소? 아, 그럼, 그렇고말고. 그런 말은 워낙 많이 들었다오.$b$b내게 양모 두루마리 하나, 솜씨 좋은 가죽세공사가 만든 산악인의 망토 한 벌, 가는 실타래, 그리고 설인 모피를 가져다주시오. 필요한 재료들을 다 구해 오면 멋진 망토를 만들어 드리리다!', '', '', '', '', '', '', 35435),
(559, 'koKR', '파렌의 증거물', '남녘해안에 있는 부관 파렌 오리넬에게 서부 해안에서 멀록을 처치하고 멀록 머리 10개를 모아야 합니다.', '이건 정말 말도 안 되지 않소? 레드패스가 지난번 우리가 처치한 멀록만으로는 만족하지 않고 있다니 말이야. 오, 그렇다고 겸손해 할 필요는 없소. 당신의 활약은 정말 대단했으니까... 레드패스가 이번에는 멀록을 처치한 증거로 차갑고 끈적끈적한 멀록 머리를 가져와서 승인을 받으라고 하고 있다오. 당신이 좀 도와주시오.', '', '', '', '', '', '', 35435),
(541, 'koKR', '언덕마루 전투', '던 가록으로 가서 던 가록 산악경비대 8명, 던 가록 소총병 4명, 던 가록 사제 2명과 부대장 아이언힐을 처치한 다음 타렌 제분소에 있는 다살리아에게 돌아와 보고해야 합니다.', '드워프가 인간을 돕고 있다고? 괘씸한 꼬마 짐승들 같으니!$b$b얼라이언스라는 놈들의 전력을 한번 시험해 볼 필요가 있겠군. 우리의 보복에도 그 조그마한 녀석들이 계속 인간을 돕는지 한번 지켜보자고. 이 지역 내에 있는 드워프 놈들의 본거지는 이미 파악되었네.$b$b녀석들은 언덕마루 남동부에 있는 소라딘의 성벽 주위의 던 가록이라는 지역에 병영을 설치했지. 이번 전투에서 자네의 마지막 임무는 던 가록을 포위 공격하는 것이야. 놈들을 지휘하고 있는 부대장 아이언힐을 반드시 처치하도록 하게.', '', '', '', '', '', '', 35435),
(533, 'koKR', '침투', '타렌 제분소에 있는 크루스크를 위해 골디르가 어디에 있는지 정보를 얻어야 합니다.', '마침내 골디르 님이 잡혀 계신 곳에 정보와 증거가 입수되기 시작했소. 인간들이 그분을 여기저기로 끌고 다니고 있지만, 수색 범위를 좁혀 여기서 바로 북쪽에 있는 대규모의 비밀결사대 야영지까지 압축되었소.$b$b그곳으로 가서 정보를 수집해 주시오.', '', '', '', '', '', '', 35435),
(515, 'koKR', '죽음의 비약', '타렌 제분소에 있는 연금술사 라이던에게 진흙주둥이 혼합물, 강렬한 트롤의 피 비약, 비수가시 비늘 5개, 그리고 너덜지느러미 눈 5개를 가져가야 합니다.', '진흙주둥이 합성물이라... 정말 훌륭한 발상이군! 왜 진작 이 생각을 못했을까? 내 부패 콜로이드를 이 악마의 혼합물에 섞어야겠네.$b$b이 진흙주둥이 혼합물의 독성을 활성화하려면 라이던에게 강렬한 트롤의 피 비약, 그리고 언덕마루 남쪽 해안에서 구할 수 있는 비수가시 일족의 비늘과 너덜지느러미 눈이 필요할 걸세. 자네가 이 실험 재료만 모두 구해다 주면 그가 알아서 할 거야. 이거, 하루빨리 그의 실험 결과를 듣고 싶군!', '', '', '', '', '', '', 35435),
(500, 'koKR', '산사태 일족 현상금', '알터랙 산맥에 있는 산사태 오우거에게서 더러운 손가락 뼈 9개를 모은 후 남녘해안에 있는 치안대장 레드패스에게 가져가야 합니다.', '산사태 오우거들이 폐허가 된 알터랙 도시 근처의 알터랙 산맥에 오우거 소굴을 만들었다네. 그리고 우리 정찰병에 따르면 놈들이 알터랙 폐허까지 점령했다고 하는군.$B$B놈들이 그곳에 진을 치도록 내버려 둘 수는 없네. 일단 그곳을 완전히 차지했다고 생각하면, 우리 진영을 공격하는데 전초 기지가 될 수 있는 구릉지까지 넘볼 것이야!$B$B북쪽의 알터랙 산맥으로 가서 오우거들을 처치해 주게나. 그리고 놈들이 가지고 있는 더러운 손가락 뼈를 가져오면 후하게 보상해 주도록 하겠네.', '', '', '', '', '', '', 35435),
(459, 'koKR', '악랄한 도둑', '델리라의 잃어버린 콩, 델리라의 잃어버린 물, 델리라의 잃어버린 자루를 회수해야 합니다.', '나쁜 그렐놈들! 놈들이 또 우리 식량 창고를 털어갔어요. 서쪽에 있는 그렐 야영지에 훔쳐간 식량들이 여기저기 흩어져 있을 거예요. 도와주실 수 있다면 그곳으로 가서 식량을 되찾아와 주시겠어요?', '', '', '', '', '', '', 35435),
(167, 'koKR', '형제여...', '스톰윈드에 있는 빌더 시슬네틀에게 시슬네틀의 배지를 가져가야 합니다.', '우리는 서부 몰락지대에 달빛시내 마을 헛간 밑에 숨겨진 거대한 광산 깊은 곳에 있었지. 그 고약한 데피아즈단 약탈자 놈들이 어디에서 왔는지 도무지 알 길이 없었소. 그건 그렇고, 우리 형제는 갱도가 무너져 광산에 갇히게 되었소. 나는 가까스로 탈출했지만 다른 사람들은... 그 후로 다른 사람들 소식을 들을 수 없었소.$b$b보아하니 당신 운이 좋은 자인 것 같은데... 우리 형을 찾아봐 준다면 정말 고맙겠소이다. 우리 형은 항상 탐험가 연맹 배지를 지니고 다녔소. 형을 찾을 순 없어도 그 배지라도 있다면 조금이나마 위안이 될 것 같소.', '', '', '', '', '', '', 35435);
